import Data from "./Data"
import './index.css'
function Prodact(){
    let [bol,setbol]=React.useState("")

    function show(price){
        setbol(price)

    }

      const arr=Data.map((el)=>{
        return(
            <>          <div className="CardList" key={el.id}>
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
          <button onClick={()=>show(el.price)}></button>
            </div>
            
            </>

        )

    
    })
    return(<div>
<div className="List">
    {arr}

</div>
</div>
    )
    }
export default Prodact
